 * Key-value payload to be passed to the server. On the server side, implementations of QueryHandler can use this data.  @abstract
 *
 * @returns {Object}
 */

/**
 * Gets the amount of rows to retrieve per page.  @abstract
 *
 * @returns {Number}
 */

