 * Gets the timeout in milliseconds to be used for the execution per coordinator. <p> A value of <code>0</code> disables client side read timeout for the execution. Default: <code>undefined</code>. </p>  @abstract
 *
 * @returns {Number}
 */

/**
 * Gets the partition key(s) to determine which coordinator should be used for the query.  @abstract
 *
 * @returns {Buffer|Array<Buffer>}
 */

